import React from 'react'
import {render} from 'react-dom'

const mystyle = {
	textAlign: 'center',
	fontSize: '20px'
}
const text = "My component";

class Container extends React.Component 
{
	constructor(props) {
    super(props);
    this.state = { isMusicPlaying: false };
  }
	render ()
	{
		return (
			<div>
				<p style= { mystyle }> { text } </p>
			</div>
		);
	}
}

function Hello ()
{
	return (
		<div>
			<p style={mystyle}> Hello world </p>
			{ Getname() }
			<Container />
		</div>
	)
}
function Getname ()
{
	return (
		<div>
			<p style={mystyle}> Hello {prompt("Print name", "root")} </p>
		</div>
	)
}

render(<Hello />, document.getElementById("root"));
